import React from 'react';
import styles from './styles.css';


const CardsDetail = () => {
    return (
        <div className='cards-container'>
            <div className='card'>
                <h3>CardsDetail 1</h3>
            </div>
            <div className='card'>
                <h3>CardsDetail 2</h3>
            </div>
            <div className='card'>
                <h3>CardsDetail 3</h3>
            </div>
        </div>
    )
}

export default CardsDetail
